import React from "react";
// import web from "../src/images/it_building.jpg";
// import { NavLink } from "react-router-dom";
import Typical from 'react-typical';
import PaintCard from "./PaintCard";
import Expert from "./Expert";


const Home = () => {

return(
    <>
      <section className="container">
 <div className="container slider">
   <div id="demo" className="carousel slide row" data-ride="carousel">

  <ul className="carousel-indicators">
    <li data-target="#demo" data-slide-to="0" className="active bg-dark"></li>
    <li data-target="#demo" data-slide-to="1" className="bg-dark"></li>
    <li data-target="#demo" data-slide-to="2" className="bg-dark"></li>
    <li data-target="#demo" data-slide-to="3" className="bg-dark"></li>
  </ul>
  
  <div className="carousel-inner">
    <div className="carousel-item active">
      <img src="../src/images/gtQaSs9Js9.jpg" alt="cover images-1" width="1100" height="400" className="col-12"/>
    </div>
    <div className="carousel-item">
      <img src="../src/images/gtQaSs9Js9.jpg" alt="cover images-2" width="1100" height="400" className="col-12"/>
    </div>
    <div className="carousel-item">
      <img src="../src/images/gtQaSs9Js9.jpg" alt="cover images-3" width="1100" height="400" className="col-12"/>
    </div>
    <div className="carousel-item">
      <img src="../src/images/gtQaSs9Js9.jpg" alt="cover images-4" width="1100" height="400" className="col-12"/>
    </div>
  </div>
  
  <a className="carousel-control-prev" href="#demo" data-slide="prev">
    <span className="carousel-control-prev-icon bg-dark"></span>
  </a>
  <a className="carousel-control-next" href="#demo" data-slide="next">
    <span className="carousel-control-next-icon bg-dark"></span>
  </a>
</div>
             </div>
          </section>


      
      <section className="body_part">     
       <PaintCard/>
      <Expert/>
      </section>

      
    </>
);
};
export default Home;
